import React, {Component} from "react";
import TopNavBar from "./TopNavBar";
import Divider from "antd/es/divider";
import slider1 from "../assets/images/slider1.png"
import Button from "antd/es/button";
class ProjectDetailComponent extends Component{
    constructor(props) {
        super(props);
        this.state = {
            id: this.props.match.params.id,
            description: ''
        }
        console.log(this.state.id)
    }

    render() {
        return (
            <div>
                <TopNavBar />
                <div className="project-container">
                    <div className="project-title">
                        project name
                    </div>
                    <div className="project-detail">
                        <div className="project-detail-head">
                            <div className="project-detail-head-wrapper" >
                                <div className="project-detail-head-title">
                                    <img src="https://assets.laioffer.com/public/companyLogo/5239c173-cf55-4a43-86f5-e555ea3c44e4.png" height="120px" width="120px" className="project-img"/>
                                    <div className="project-title-right">
                                        <h2>Project name</h2>
                                        <span>company name</span><br/><br/>
                                        <span>time</span>
                                    </div>
                                </div>
                                <div className="project-apply">
                                    <Button type="primary" shape="round" size='large'>
                                        Apply
                                    </Button>
                                </div>
                            </div>
                        </div>
                        <Divider />
                        <div className="project-detail-body">
                            body
                        </div>

                    </div>

                </div>
            </div>
        )
    }
}

export default ProjectDetailComponent;
